  // **********************************************
  // Appende gli oggetti al CmdHandler fornito
  // **********************************************
  public void AppendTo(CmdHandler Dst)
  {
    // Se ho command set
    if (CmdSets.length > 0)
    {
      // Se  la prima volta, appendo
      if (MyCmdHandler.CMDS_OFFSET == 0)
      {
        // Se vengono caricati componenti dinamicamente devo tenere conto del fatto che c' una "zona" dell'array
        // che  riservata a componenti che ho gi caricato ma che non sono presenti nell'array di questa sessione. 
        // Es: sessione 1 carica Comp1, sessione 2 carica Comp2 in questo caso la sessione 2 non ha mai caricato 
        // Comp1 ma se dovesse farlo deve esserci spazio per le sue tabelle IMDB nello stesso posto in cui erano prima!)
        // Pertanto se lo stato di riempimento  inferiore o uguale alla lunghezza dell'array, appendo in fondo
        //
        // Per cominciare appendo tutti i CmdSet contenuti in Dst dentro al mio array
        int idx = Math.max(Dst.CmdSets.length, com.progamma.is.CmdHandler.FilledTo[0]);
        if (idx == 0) idx = 1;    // L'array dei cmdset  1-based
        //
        ACommand[] oldCmdSets = Dst.CmdSets;
        Dst.CmdSets = new ACommand[idx + CmdSets.length - 1];
        System.arraycopy(oldCmdSets, 0, Dst.CmdSets, 0, oldCmdSets.length);
        for (int i = 1; i < CmdSets.length; i++)
        {
          ACommand c = CmdSets[i];
          if (c == null)
            continue;
          //
          if (c.IdxForm > 0)
            c.IdxForm += MainFrm.CompOwner.iFrmOffs.intValue();   // Shifto le referenze alle form
          //
          c.Index = idx;
          Dst.CmdSets[idx++] = c;
        }
      }
      else // Il componente  gi stato inizializzato in precedenza... infilo i CmdSet dove li ho messi l'ultima volta
      {
        // L'array di mio padre potrebbe essere pi grande del mio se i componenti sono "dinamici" e vengono caricati in un 
        // ordine diverso da quello precedente (es: app->cmp1->cmp2 e poi, in una sessione differente app->cmp2->cmp1)
        ACommand[] oldCmdSets = Dst.CmdSets;
        Dst.CmdSets = new ACommand[Math.max(CmdSets.length, oldCmdSets.length)];
        System.arraycopy(oldCmdSets, 0, Dst.CmdSets, 0, oldCmdSets.length);
        //
        System.arraycopy(CmdSets, MyCmdHandler.CMDS_OFFSET + 1, Dst.CmdSets, MyCmdHandler.CMDS_OFFSET + 1, CmdSets.length - (MyCmdHandler.CMDS_OFFSET + 1));
      }
      //
      // Aggiorno lo stato di riempimento dell'array
      com.progamma.is.CmdHandler.FilledTo[0] = Math.max(Dst.CmdSets.length, com.progamma.is.CmdHandler.FilledTo[0]);
      //
      // Se non l'ho ancora fatto shifto tutte le costanti contenute in MyGlb
      if (MyCmdHandler.CMDS_OFFSET == 0)
      {
        // Il mio offset  il numero di commandset di tutti i miei padri...
        // Per calcolarlo guardo a dove  finito il mio primo commandset (l'elemento 0  NULL)
        // Quello  l'offset dei miei commandset rispetto all'array che contiene tutti i commandset di tutti i componenti
        MyCmdHandler.CMDS_OFFSET = CmdSets[1].Index - 1;
        ShiftStaticConstCmdSet(MainFrm);
      }
    }
    //
    // Se ho comandi
    if (CmdLin.length > 0)
    {
      // Poi proseguo con i comandi
      // Se  la prima volta, appendo
      if (MyCmdHandler.CMD_OFFSET == 0)
      {
        // Se vengono caricati componenti dinamicamente devo tenere conto del fatto che c' una "zona" dell'array
        // che  riservata a componenti che ho gi caricato ma che non sono presenti nell'array di questa sessione. 
        // Es: sessione 1 carica Comp1, sessione 2 carica Comp2 in questo caso la sessione 2 non ha mai caricato 
        // Comp1 ma se dovesse farlo deve esserci spazio per le sue tabelle IMDB nello stesso posto in cui erano prima!)
        // Pertanto se lo stato di riempimento  inferiore o uguale alla lunghezza dell'array, appendo in fondo
        //
        int idx = Math.max(Dst.CmdLin.length, com.progamma.is.CmdHandler.FilledTo[1]);
        if (idx == 0) idx = 1;    // L'array dei cmdset  1-based
        ACommand[] oldCmdLin = Dst.CmdLin;
        Dst.CmdLin = new ACommand[idx + CmdLin.length - 1];
        System.arraycopy(oldCmdLin, 0, Dst.CmdLin, 0, oldCmdLin.length);
        for (int i = 1; i < CmdLin.length; i++)
        {
          ACommand c = CmdLin[i];
          if (c == null)
            continue;
          //
          if (c.IdxForm > 0)
            c.IdxForm += MainFrm.CompOwner.iFrmOffs.intValue();   // Shifto le referenze alle form
          //
          c.Index = idx;
          Dst.CmdLin[idx++] = c;
        }
      }
      else  // Il componente  gi stato inizializzato in precedenza... infilo i comandi dove li ho messi l'ultima volta
      {
        // L'array di mio padre potrebbe essere pi grande del mio se i componenti sono "dinamici" e vengono caricati in un 
        // ordine diverso da quello precedente (es: app->cmp1->cmp2 e poi, in una sessione differente app->cmp2->cmp1)
        ACommand[] oldCmdLin = Dst.CmdLin;
        Dst.CmdLin = new ACommand[Math.max(CmdLin.length, oldCmdLin.length)];
        System.arraycopy(oldCmdLin, 0, Dst.CmdLin, 0, oldCmdLin.length);
        //
        System.arraycopy(CmdLin, MyCmdHandler.CMD_OFFSET + 1, Dst.CmdLin, MyCmdHandler.CMD_OFFSET + 1, CmdLin.length - (MyCmdHandler.CMD_OFFSET + 1));
      }
      //
      // Aggiorno lo stato di riempimento dell'array
      com.progamma.is.CmdHandler.FilledTo[1] = Math.max(Dst.CmdLin.length, com.progamma.is.CmdHandler.FilledTo[1]);
      //
      // Se non l'ho ancora fatto shifto tutte le costanti contenute in MyGlb
      if (MyCmdHandler.CMD_OFFSET == 0)
      {
        // Il mio offset  il numero di comandi di tutti i miei padri...
        // Per calcolarlo guardo a dove  finito il mio primo comando (l'elemento 0  NULL)
        // Quello  l'offset dei miei comandi rispetto all'array che contiene tutti i comandi di tutti i componenti
        MyCmdHandler.CMD_OFFSET = CmdLin[1].Index - 1;
        ShiftStaticConstCmdLin(MainFrm);
      }
    }
  }
  
  public static void ShiftStaticConstCmdSet(WebEntryPoint MainFrm)
  {
    if (MyCmdHandler.CMDS_OFFSET != 0)
    {
      try
      {
        String tn = (Glb.ClassWithPackage(MainFrm.getClass()) ? MainFrm.getClass().getPackage().getName() + "." : "");
        Field[] props = Class.forName(tn + "MyGlb").getFields();
        for (int j = 0; j < props.length; j++)
        {
          Field p = props[j];
          if (p.getName().startsWith("CMDS_") || p.getName().equals("MAX_COMMAND_SETS"))
            p.setInt(null, p.getInt(null) + MyCmdHandler.CMDS_OFFSET);
        }
      }
      catch (Exception e)
      {
        e.printStackTrace(System.err);
      }
    }
  }
  public static void ShiftStaticConstCmdLin(WebEntryPoint MainFrm)
  {
    if (MyCmdHandler.CMD_OFFSET != 0)
    {
      try
      {
        String tn = (MainFrm.getClass().getPackage() != null ? MainFrm.getClass().getPackage().getName() + "." : "");
        Field[] props = Class.forName(tn + "MyGlb").getFields();
        for (int j = 0; j < props.length; j++)
        {
          Field p = props[j];
          if (p.getName().startsWith("CMD_") || p.getName().equals("MAX_COMMANDS"))
            p.setInt(null, p.getInt(null) + MyCmdHandler.CMD_OFFSET);
        }
      }
      catch (Exception e)
      {
        e.printStackTrace(System.err);
      }
    }
  }
  
  // **************************************
  // Caricamento sessione da file (Serializable)
  // **************************************
  public static void readObject(WebEntryPoint MainFrm, ObjectInputStream in) throws Exception
  {
    // Leggo propriet statiche
    // Se l'offset era gi impostato devo prima de-offsettare tutte le define statiche prima di poter caricare il nuovo contesto statico
    if (MyCmdHandler.CMDS_OFFSET != 0)
    {
      MyCmdHandler.CMDS_OFFSET = -MyCmdHandler.CMDS_OFFSET;
      ShiftStaticConstCmdSet(MainFrm);
    }
    if (MyCmdHandler.CMD_OFFSET != 0)
    {
      MyCmdHandler.CMD_OFFSET = -MyCmdHandler.CMD_OFFSET;
      ShiftStaticConstCmdLin(MainFrm);
    }
    //
    MyCmdHandler.CMDS_OFFSET = in.readInt();
    MyCmdHandler.CMD_OFFSET = in.readInt();
    CmdHandler.FilledTo[0] = in.readInt();
    CmdHandler.FilledTo[1] = in.readInt();
    ShiftStaticConstCmdSet(MainFrm);
    ShiftStaticConstCmdLin(MainFrm);
  }
  public static void writeObject(WebEntryPoint MainFrm, ObjectOutputStream out) throws Exception
  {
    // Scrivo propriet statiche
    out.writeInt(MyCmdHandler.CMDS_OFFSET);
    out.writeInt(MyCmdHandler.CMD_OFFSET);
    out.writeInt(CmdHandler.FilledTo[0]);
    out.writeInt(CmdHandler.FilledTo[1]);
  }
